  \"A Plateau-Burning, Low Temperature-Operable Solid Propellant for Mars Sample Return
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T06:10:22.139076\",\n\t\"name\":
  \"a-plateau-burning-low-temperature-operable-solid-propellant-for-mars-sample-return-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Mars ascent vehicle (MAV) is required
  to endure a long space transit time, high-g loading during planetary entry, and
  high launch loads, all at low temperatures of approximately -40 Deg C.   Additionally,
  low-temperature motors like the MAV are often tested at room temperature, since
  testing at temperatures of -40 Deg C or lower is both difficult and expensive.  Since
  testing at higher temperatures results in higher burn rates for typical propellants,
  and thus higher working pressures, ambient tests result in a motor case that is
  heavier than required for a low temperature mission, because ambient testing results
  in a higher maximum expected operating pressure.  Our proposed technology alleviates
  that problem by using a plateau-burning composite propellant that will substantially
  lessen the burn rate sensitivity to temperature.  As such, the MAV operating pressure
  in ambient conditions will more closely resemble those on the Mars surface, allowing
  for a lighter motor case resulting in reduced weight, smaller volume and greater
  propellant mass fractions.  Additionally, our plateau burning formulation will include
  a low temperature binder with a high density fuel additive, in order to alleviate
  the loading stresses at low temperatures and further increase the motor density-Isp.
  \ This may allow us to eliminate the need for the MAV launch erection equipment
  currently baselined for the MSR mission.\",\n\t\"license_title\": \"U.S. Government
